Трансперсональный психолог. Лайф-коуч. Преподаватель практик осознанности (mindfulness). Ведущая трансформационной игры Лила Чакра. 

С какими запросами я могу помочь:
◈ самореализация;
◈ сложности, кризисы в личных отношениях (семья, друзья, партнеры);
◈ обида на себя, родителей, бывших партнёров;
◈ страхи, стресс, тревожность;
◈ мешающие жить негативные эмоции (стыд, вина, зависть, ревность и пр.)
◈ психологические травмы;
◈ ограничивающие убеждения, негативные родовые программы;
◈ найти свою уникальность, сильные стороны;
◈ найти внутреннюю опору;
◈ любовь к себе, самооценка;
◈ поиск мотивации для достижения целей;
◈ поиск своего предназначения, поиск смысла жизни;
◈ обретение внутренней гармонии.

Я глубоко убеждена, что в каждом из нас есть мудрость. Просто порой к ней нужно указать маршрут. ☝
